import React from 'react';
import NewsSlider from '../../../Widgets/NewsSlider/slider';
import moduleName from 'module';

const NewsMain = () => (
    
        <div>
            <NewsSlider
                type="featured"
                settings={{dots:false}}
                start={0}
                amount={3}
                />
        </div>
    )

export default NewsMain;
